+static void
+xmlSchematronFreeRules(xmlSchematronRulePtr rules) {
+    xmlSchematronRulePtr next;
+
+    while (rules != NULL) {
+        next = rules->next;
+        if (rules->tests)
+            xmlSchematronFreeTests(rules->tests);
+        if (rules->context != NULL)
